  `is_virtual` varchar(32) NOT NULL DEFAULT '0' COMMENT '是否为虚拟商品 1是，0否',
  `virtual_indate` decimal(10,0) DEFAULT NULL COMMENT '虚拟商品有效期',
  `virtual_limit` decimal(10,0) DEFAULT '0' COMMENT '虚拟商品购买上限',
  `virtual_refund` varchar(32) DEFAULT '1' COMMENT '是否允许过期退款， 1是，0否',
  `is_on_sale` varchar(32) NOT NULL DEFAULT '1' COMMENT '是否上架 0-未上架 1-销售中',
  `is_free_shipping` varchar(32) NOT NULL DEFAULT '0' COMMENT '是否包邮0否1是',
  `on_time` datetime NOT NULL COMMENT '商品上架时间',
