  `is_hot` varchar(32) DEFAULT '0' COMMENT '是否热卖',
  `modified` datetime NOT NULL COMMENT '更新时间',
  `goods_type` varchar(128) NOT NULL DEFAULT '0' COMMENT '商品所属类型id，取值表goods_type的id',
  `spec_type` varchar(128) DEFAULT '0' COMMENT '商品规格类型，取值表goods_type的id',
  `give_integral` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '购买商品赠送积分',
