  `suppliers_id` varchar(128) NOT NULL DEFAULT '0' COMMENT '供货商ID',
  `sales_sum` decimal(10,0) DEFAULT '0' COMMENT '商品销量',
  `prom_type` varchar(32) DEFAULT '0' COMMENT '0默认1抢购2团购3优惠促销4预售5虚拟(5其实没用)6拼团',
  `prom_id` varchar(128) NOT NULL DEFAULT '0' COMMENT '优惠活动id',
  `commission` decimal(10,2) DEFAULT '0.00' COMMENT '佣金用于分销分成',
