  `sku` varchar(128) CHARACTER SET utf8 DEFAULT '' COMMENT 'SKU',
  `template_id` varchar(128) DEFAULT '0' COMMENT '运费模板ID',
  `goods_video` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '视频',
  `created` datetime DEFAULT NULL,
  `shop_id` varchar(128) DEFAULT '0',
