  `openid` varchar(100) CHARACTER SET utf8 DEFAULT '' COMMENT '会员微信OPENID',
  `phone` varchar(16) CHARACTER SET utf8 DEFAULT '' COMMENT '会员手机号',
  `password` varchar(64) CHARACTER SET utf8 DEFAULT '' COMMENT '登录密码',
  `nickname` varchar(20) CHARACTER SET utf8 DEFAULT '' COMMENT '会员昵称',
